import React from 'react';
import { LaptopOutlined, NotificationOutlined, UserOutlined } from '@ant-design/icons';
import { Breadcrumb, Layout, Menu, theme } from 'antd';
import Nav from './component/Nav';
//import Search from './component/Search';

const { Header, Content, Footer, Sider } = Layout;
// const homePage={
//   name:"店铺主页",
//   logo:"<HomeOutlined style={{ fontSize: '30px', color: 'orange' }}/>"

// }
// const homePage2={
//   name:"购物车",
//   logo:"<HomeOutlined style={{ fontSize: '30px', color: 'orange' }}/>"

// }
// const items1 = [homePage, homePage2].map((key) => ({
//   key.name,
//   label: `${key.name}`,
//   logo:key.logo
// }));
const items1 = <Nav/>

const items2 = [UserOutlined, LaptopOutlined, NotificationOutlined].map((icon, index) => {
  const key = String(index + 1);
  return {
    key: `sub${key}`,
    icon: React.createElement(icon),
    label: `subnav ${key}`,
    children: new Array(4).fill(null).map((_, j) => {
      const subKey = index * 4 + j + 1;
      return {
        key: subKey,
        label: `option${subKey}`,
      };
    }),
  };
});
const App = () => {
  const {
    token: { colorBgContainer },
  } = theme.useToken();
  return (
    <Layout>
      <Header className="header">
        <div className="logo" />
        <Menu theme="light" mode="horizontal" defaultSelectedKeys={['店铺主页']} items={items1}/>
      </Header>
      <Content
        style={{
          padding: '0 50px',
        }}
      >
        <Breadcrumb
          style={{
            margin: '16px 0',
          }}
        >

          <Breadcrumb.Item>aa</Breadcrumb.Item>

        </Breadcrumb>
        <Layout
          style={{
            padding: '24px 0',
            background: colorBgContainer,
          }}
        >
          <Sider
            style={{
              background: colorBgContainer,
            }}
            width={200}
          >
            <Menu
              mode="inline"
              defaultSelectedKeys={['1']}
              defaultOpenKeys={['sub1']}
              style={{
                height: '100%',
              }}
              items={items2}
            />
          </Sider>
          <Content
            style={{
              padding: '0 24px',
              minHeight: 280,
            }}
          >
            Content
          </Content>
        </Layout>
      </Content>
      <Footer
        style={{
          textAlign: 'center',
        }}
      >
        大桔株式会社2023
      </Footer>
    </Layout>
  );
};
export default App;
